import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const AdminScreen = () => {
  return (
    <View>
      <Text>AdminScreen</Text>
    </View>
  )
}

export default AdminScreen

const styles = StyleSheet.create({})
